import './Style/App.css';
import './Style/Base.css';
import logo from '../Image/Logo.png'
import iconMyPack from '../Image/icon\ 1.png'
function App() {
  return (
    <div className="background">
      <div className='logo'>
          <img src={logo}/>
      </div>
      <div className='MyPacks'>          
      </div>
      <img className='icon' src={iconMyPack}/>
      <div className='MyPack-text'>MY PACKS</div>
    </div>

  );
}

export default App;
